import * as React from 'react';
import Chip from '@mui/material/Chip';
import Stack from '@mui/material/Stack';
const tags = [{
    label: "Saddle Bags", color: "primary"
},
{
    label: "Tote Bags", color: "primary"
},
{
    label: "Messenger Bags", color: "primary"
}]

export default function Tags() {
    return (
        <Stack spacing={1} alignItems="center">
            <Stack direction="row" spacing={1}>

                {
                    tags.map((tag, index) => {
                        return (
                            <div>
                                <Chip label={tag.label} color={tag.color} clickable={true} variant="filled" />
                            </div>
                        )
                    })
                }


            </Stack>

        </Stack>
    )
}
